let swords = [], gates = [];
const gilImg = new Image();
gilImg.src = "data:image/png;base64,";
gilImg.onload = () => { readyToDrawGil = true; };
let readyToDrawGil = false;

window.addEventListener("keydown", e => e.code === "KeyG" && launch());

originalClearCanvas = Runner.instance_.clearCanvas;

function updateGates(r, t) {
    gates = [];
    const sx = 12, sy = 14, cols = 3, rows = 5;
    const bx = Math.max(30, r.tRex.xPos - 70 - sx * 6), by = r.tRex.yPos + 10;
    for (let i = 0; i < rows; i++)
        for (let j = 0; j < cols; j++)
            gates.push({x: bx + j * sx, y: by - ((rows - 1) / 2) * sy + i * sy + Math.sin(t / 500 + i + j) * 2});
}

function launch() {
    const r = Runner.instance_, obs = r.horizon.obstacles[0];
    if (!obs || gates.length < 3) return;
    const s = [];
    while (s.length < 3) {
        let i = Math.floor(Math.random() * gates.length);
        if (!s.includes(i)) s.push(i);
    }
    s.forEach(i => {
        let g = gates[i];
        swords.push({x: g.x, y: g.y, target: obs, speed: 9 + Math.random() * 3, angle: 0, hit: false});
    });
}

function drawGate(c, x, y) {
    c.save();
    c.beginPath();
    c.arc(x, y, 5, 0, Math.PI * 2);
    c.lineWidth = 1.5;
    c.strokeStyle = "rgba(255, 255, 100, 0.85)";
    c.shadowColor = "yellow";
    c.shadowBlur = 15;
    c.stroke();
    c.restore();
}

function drawSword(c, x, y, a) {
    c.save();
    c.translate(x, y);
    c.rotate(a);
    c.beginPath();
    c.moveTo(-15, 0);
    c.lineTo(15, 0);
    c.lineWidth = 2.5;
    c.strokeStyle = "white";
    c.shadowColor = "gold";
    c.shadowBlur = 15;
    c.stroke();
    c.beginPath();
    c.moveTo(0, -5);
    c.lineTo(0, 5);
    c.lineWidth = 2;
    c.strokeStyle = "gold";
    c.shadowColor = "white";
    c.shadowBlur = 8;
    c.stroke();
    c.restore();
}

function drawGilgamesh(ctx, x, y) {
    if (readyToDrawGil) ctx.drawImage(gilImg, x - 20, y - 40, 50, 70); 
}

function animate(t = 0) {
    requestAnimationFrame(animate);
    try {
        const r = Runner.instance_, ctx = r?.canvasCtx;
        if (!ctx) return;
        ctx.clearRect(0, 0, ctx.canvas.width, ctx.canvas.height);
        updateGates(r, t);
        gates.forEach(g => drawGate(ctx, g.x, g.y));
        swords.forEach(s => {
            if (s.hit || !s.target) return;
            const tx = s.target.xPos + 10, ty = s.target.yPos + 10;
            const dx = tx - s.x, dy = ty - s.y, d = Math.hypot(dx, dy);
            if (d < 10) {
                s.hit = true;
                if (r.horizon.obstacles[0] === s.target) r.horizon.removeFirstObstacle();
                return;
            }
            const nx = dx / d, ny = dy / d;
            s.x += nx * s.speed;
            s.y += ny * s.speed;
            s.angle = Math.atan2(ny, nx);
            drawSword(ctx, s.x, s.y, s.angle);
        });
        swords = swords.filter(s => !s.hit);

        drawGilgamesh(ctx, r.tRex.xPos + 20, r.tRex.yPos + 20);

        r.tRex.draw = () => {};
        r.clearCanvas = () => {};
    } catch {}
}

animate();
